import React, { useEffect, useState } from 'react';
import { useDispatch } from 'react-redux';
import logo from '../resources/logo.png';

import ActiveUsersList from './components/ActiveUsersList/ActiveUsersList';
import { saveActiveUsers } from '../store/actions/dashboard';

import './Dashboard.css';

const Dashboard = () => {

  const dispatch = useDispatch();

  const activeUsersList = localStorage.getItem('activeUsers') ? JSON.parse(localStorage.getItem('activeUsers')) : [];

  console.log({activeUsersList}, 'dashboard');

  const [activeUsers, setActiveUsers ] = useState(activeUsersList)

  useEffect(() => {
      // setActiveUsers([...activeUsers]);
      setActiveUsers(...setActiveUsers);
      dispatch(saveActiveUsers([...activeUsers]));
      console.log({activeUsers});
  }, [activeUsers, dispatch]);

  return (
    <div className='dashboard_container background_main_color'>
      <div className='dashboard_left_section'>
        <div className='dashboard_content_container'>
            content
        </div>
        <div className='dashboard_rooms_container background_secondary_color'>
            rooms
        </div>
      </div>
      <div className='dashboard_right_section background_secondary_color'>
        <div className='dashboard_active_users_list'>
          <ActiveUsersList />
        </div>
        <div className='dashboard_logo_container'>
          <img alt="" className='dashboard_logo_image' src={logo} />
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
